import React, { Component } from 'react';
import CharCard from './CharCard';




export default class CharList extends Component {


    render(){
        return(
            <div className="row">           
                <CharCard />
                <CharCard id="1"/>
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />
                <CharCard />

            </div>
        );      
    }   
}
